import {makeAutoObservable} from "mobx";

export default class sellerStore {
    constructor() {
        this._isAuth = false
        this._seller = {}
        this.id = -1
        makeAutoObservable(this)
    }
    setIsAuth(bool) {
        this._isAuth = bool
    }
    setSeller(seller) {
        this._seller = seller
    }
    setSellerID(value) {
        this.id = value
    }
    get isAuth() {
        return this._isAuth
    }
    get seller() {
        return this._seller
    }
    get sellerID() {
        return this.id
    }
}
